import React from 'react';
import './master.css';

class Mundo extends React.Component {

state = { region1 : ""};

componentDidMount() {
    this.setState({ region1 : "azul" });
 }


render() { 

  return (  
            <div className="App">
              <div className="banner-container">
              <img src="/images/map_banner.png"/>
                <div className="banner-text">Hackathon blablabla</div>
              </div>
	      <p className="map-title" align="center">MAPA</p>
	      <img src="/images/linea1.png"/>

	      <div className="map-container">
	      <div className="warrior"><img src="/images/warrior.png"/></div>
	      <div className="region1"><img src="/images/region-1.png"/></div>
	   	if (this.state.region1 != "") { 
                    <div className="ganador-region1"><img src="/images/equipo-{this.state.region1}.png"/></
div>  }
   	     <div className="region2"><img src="/images/region-2.png"/></div>
	      <div className="region3"><img src="/images/region-3.png"/></div>
	      <div className="region4"><img src="/images/region-4.png"/></div>
	      <div className="region5"><img src="/images/region-5.png"/></div>
	      <div className="region6"><img src="/images/region-6.png"/></div>
	     </div>      
	     <p className="map-title" align="center">REGIONES</p>
	     <img src="/images/linea2.png"/>
             <table className="tabla-regiones"><tr><td> 1 - ARQUITECTURA </td><td> 2 - OBSERVABILIDAD </td></tr><tr><td>3 - AI & ML </td>
	  <td> 4 - SEGURIDAD </td></tr></table>



     </div>
  )

}

}     


export default Mundo;
